import React from "react";
import "./MickeyCard.css";

const Card = props => {
  return (
    <div className="wrapper">
      <div className="card">
        <div className="img-container">
          <img
            src={props.image}
            alt="-mickey-character"
            onClick={() => {
              console.log("hi");
              props.click;
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default Card;
